#include "kernel.h"
#include <gtest/gtest.h>
#include <stdlib.h>

TEST(_14, _fl)
{
    char *in[] = {"flower", "flow", "flight"};
    int n_str = 3;
    char *ret = longestCommonPrefix(in, n_str);
    EXPECT_STREQ(ret, "fl");
    free(ret);
}

TEST(_14, _no_common)
{
    char *in[] = {"dog", "racecar", "car"};
    int n_str = 3;
    char *ret = longestCommonPrefix(in, n_str);
    EXPECT_STREQ(ret, "");
    free(ret);
}

TEST(_14, _empty)
{
    char **in = NULL;
    int n_str = 0;
    char *ret = longestCommonPrefix(in, n_str);
    EXPECT_STREQ(ret, "");
    free(ret);
}

